import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    createStyles,
    Paper,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    Theme,
    withStyles,
    WithStyles,
} from '@material-ui/core';
import _ from 'lodash';
import employees from '../data/employees.json';
//import classes from '*.module.css';

export interface IState {
    apiurl: string;
    datarecords: any[];
    datacolumns: any[];
}

export default class FetchTableData extends React.Component{

    //constructor(props:IState) {
    //    super(props);
    //    this.state = {
    //        apiurl:'',
    //        datarecords: [],
    //        datacolumns: [],
    //    }
    //}

    state = {
        datarecords: [],
    }

    componentDidMount() {
        axios.get('http://dummy.restapiexample.com/api/v1/employees')
            .then(response => {

                this.setState({ datarecords: response.data });
                console.log(this.state.datarecords);
                
            })
            .catch(error => {

            })
    }

    //private extractColumnNames() {
    //    const firstrecord = _.keys(this.state.datarecords[0]);
    //    this.setState({ datacolumns: firstrecord });
    //    console.log(firstrecord);
    //}


    
    render() {
        const datarecords = this.state.datarecords;

        const list = this.state.datarecords.map(emp => {
            <div>{emp.id}</div>
        })

        return(
        <Paper >
            <p>Employee List</p>

            <Table >
                    <TableHead>

                    <TableRow>
                        <TableCell>Id</TableCell>
                        <TableCell>Employee Name</TableCell>
                        <TableCell>Salary</TableCell>
                        <TableCell>Age</TableCell>
                    </TableRow>
                </TableHead>
                    <TableBody>
                        {employees.map(row => {
                            return (

                                <TableRow key={row.id}>
                                    <TableCell>{row.id}</TableCell>
                                    <TableCell>{row.employee_name}</TableCell>
                                    <TableCell>{row.employee_salary}</TableCell>
                                    <TableCell>{row.employee_age}</TableCell>
                                </TableRow>
                            );
                        })}
                    </TableBody>   
            </Table>
        </Paper>
            
        );
    }
}
